package com.onyx.libedu.model;import com.onyx.android.sdk.data.model.BaseData;/** * Created by ming on 2016/11/1. */public class QuestionType extends BaseData {    private String questionTypeName;    public String getQuestionTypeName() {        return questionTypeName;    }    public void setQuestionTypeName(String questionTypeName) {        this.questionTypeName = questionTypeName;    }    public static QuestionType createDefaultType() {        return create(1);    }    public static QuestionType create(long id) {        QuestionType questionType = new QuestionType();        questionType.setId(id);        return questionType;    }}